import { Route } from "react-router-dom";
import { Redirect } from 'react-router'

import React from "react";

const PrivateRoute = ({ children, ...args }) => {
  const auth = false;

  return (
    <Route {...args}>
      {!auth ? <Redirect to="/login" /> : children}{" "}
    </Route>
  );
};

export { PrivateRoute };
